import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  <div>
    <ExpenseItem
      title={props.expeses[0].title}
      amount={props.expeses[0].amount}
      date={props.expeses[0].date.toISOString()}
    ></ExpenseItem>
    <ExpenseItem
      title={props.expeses[1].title}
      amount={props.expeses[1].amount}
      date={props.expeses[1].date.toISOString()``}
    ></ExpenseItem>
    <ExpenseItem
      title={props.expeses[2].title}
      amount={props.expeses[2].amount}
      date={props.expeses[2].date.toISOString()}
    ></ExpenseItem>
    <ExpenseItem
      title={props.expeses[3].title}
      amount={props.expeses[3].amount}
      date={props.expeses[3].date}
    ></ExpenseItem>
  </div>;
}

export default Expenses;
